const BlogList = () => {
  const blogs = [{
    title:"js",
    content:"jsssssss"
  },
  {
    title:"js",
    content:"jsssssss"
  }
];
  const blog = () => 
    blogs.map(blog => (
      <div className="p-5 flex align-items-center justify-content-between">
        <div>
          <h2>{blog.title}</h2>
          <p>{blog.content}</p>
        </div>
        <div>

        </div>
      </div>
    ));

  return <>{blogs.length ? blog() : <p>NoBlogs</p>}</>;
};

export default BlogList;
